import React from 'react';

const Home = () => {
    return(
        <section id='home' className='home'>
            <div className='home_text-wrapper'>
                <h1>
                    Hello, I'm Thiri May Thu
                    <br />
                    Junior Web Developer
                </h1>
            </div>
        </section>
    )
}

export default Home;
